MongoDB - Mongoose query findOneAndUpdate() doesn't update/duplicates the DB<p>I am trying to save and update <code>findOneAndUpdate()</code> (<code>{upsert: true}</code> - creates the object if it doesn't exist) the result of the Web Api which contains multiple arrays of data to populate the stock chart. Each time I enter a symbol and click the "Get Quote" button it should fetch data from the web api, save/update  it under the Child Schema in the database. How can I do this with nodejs and mongoose? Here is the code that I tried....</p>

<p><strong>Folder - Models - Stock.js</strong></p>

<pre><code>const mongoose = require('mongoose')
mongoose.Promise = global.Promise
mongoose.connect('mongodb://localhost:27017/myapp', { useNewUrlParser: true })
const slug = require('slug')


const childSchemaData = new mongoose.Schema({
  date: mongoose.Decimal128,
  open: mongoose.Decimal128,
  high: mongoose.Decimal128,
  low: mongoose.Decimal128,
  close: mongoose.Decimal128,
  volume: mongoose.Decimal128
})

const parentSchemaSymbol = new mongoose.Schema({
  symbol: {
    type: String,
    trim: true,
    minlength: 2,
    maxlength: 4,
    required: 'Plese enter a valid symbol, min 2 characters and max 4'
  },
  // Array of subdocuments
  data: [childSchemaData],
  slug: String

});

//we have to PRE-save slug before save the parentSchemaSymbol into DB
parentSchemaSymbol.pre('save', function (next) {
  if (!this.isModified('symbol')) {
    next()//skip it
    return//stop this function from running
  }
  this.slug = slug(this.symbol)
  next()
  //TODO make more resiliant soslug are unique
})

module.exports = mongoose.model('Stock', parentSchemaSymbol)
</code></pre>

<p><strong>Controller - webApiController.js</strong></p>

<pre><code>const mongoose = require('mongoose')
const axios = require('axios')

require('../models/Stock')
const parentSchemaSymbol = mongoose.model('Stock')



mongoose.Promise = global.Promise // Tell Mongoose to use ES6 promises
// Connect to our Database and handle any bad connections
mongoose.connect('mongodb://localhost:27017/myapp', { useNewUrlParser: true })
mongoose.connection.on('error', (err) =&gt; {
  console.error(`         ${err.message}`)
})

exports.webApi = (req, res) =&gt; {
  let curValue = req.params.symbol

  axios.get(`https://www.alphavantage.co/query?function=TIME_SERIES_DAILY&amp;symbol=${curValue}&amp;outputsize=compact&amp;apikey=TUVR`)
    .then(response =&gt; {
      return highLow = Object.keys(response.data['Time Series (Daily)']).map(date =&gt; {
        return {
          date: Date.parse(date),
          open: Math.round(parseFloat(response.data['Time Series (Daily)'][date]['1. open']) * 100) / 100,
          high: Math.round(parseFloat(response.data['Time Series (Daily)'][date]['2. high']) * 100) / 100,
          low: Math.round(parseFloat(response.data['Time Series (Daily)'][date]['3. low']) * 100) / 100,
          close: Math.round(parseFloat(response.data['Time Series (Daily)'][date]['4. close']) * 100) / 100,
          volume: parseInt(response.data['Time Series (Daily)'][date]['5. volume'])
        }
      })

    })
    .then(_ =&gt; {

      let curValueSchema = new parentSchemaSymbol()

      curValueSchema.symbol = curValue
      highLow.map(item =&gt; {
        curValueSchema.data.push(item)
      })
      const query = { symbol: `${curValue.toUpperCase()}` }
      const update = { $addToSet: { data: [curValueSchema.data] } }
      const options = { upsert: true, new: true }
      curValueSchema.findOneAndUpdate(query, update, options).then(doc =&gt; {
        console.log('Saved the symbol', doc)
        return res.send(highLow)
      }).catch(e =&gt; {
        console.log(e)
      })
    })
    .catch(error =&gt; {
      console.log(error)
    })
}
</code></pre>

<p><strong>Here is the piece of code that I am looking to fix. The rest is working:</strong></p>

<pre><code> let curValueSchema = new parentSchemaSymbol()

      curValueSchema.symbol = curValue
      highLow.map(item =&gt; {
        curValueSchema.data.push(item)
      })
      const query = { symbol: `${curValue.toUpperCase()}` }
      const update = curValueSchema
      const options = { upsert: true, new: true }
      curValueSchema.findOneAndUpdate(query, update, options).then(doc =&gt; {
        console.log('Saved the symbol', doc)
        return res.send(highLow)
      }).catch(e =&gt; {
        console.log(e)
      })
</code></pre>

<p><strong>Here is the error I am getting</strong></p>

<pre><code>TypeError: curValueSchema.findOneAndUpdate is not a function
    at axios.get.then.then._ (/mnt/c/Users/john/Desktop/node/controllers/webApiController.js:55:22)
    at process._tickCallback (internal/process/next_tick.js:178:7)
</code></pre>

<p><strong>Here is the data  = highLow</strong></p>

<p><a href="https://i.stack.imgur.com/PZZyy.jpg" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/PZZyy.jpg" alt="enter image description here"></a></p>

<p><strong><em>SOLUTION</em></strong></p>

<p>Because Mongoose by default creates a new MongoDB ObjectId ( this hidden _id field) every time you pass it a Javascript Object to update the field of a document.</p>

<p>To go around you can tell Mongoose to not create a new ObjectId, by making sure your mongoose schema is as followed:</p>

<p><strong>Folder - Models - Stock.js</strong></p>

<pre><code>const mongoose = require('mongoose')
mongoose.Promise = global.Promise
mongoose.connect('mongodb://localhost:27017/myapp', { useNewUrlParser: true })
const slug = require('slug')


const childSchemaData = new mongoose.Schema({
  "_id": false,
  date: mongoose.Decimal128,
  open: mongoose.Decimal128,
  high: mongoose.Decimal128,
  low: mongoose.Decimal128,
  close: mongoose.Decimal128,
  volume: mongoose.Decimal128
})

const parentSchemaSymbol = new mongoose.Schema({
  "_id": false,
  symbol: {
    type: String,
    trim: true,
    minlength: 2,
    maxlength: 4,
    required: 'Plese enter a valid symbol, min 2 characters and max 4'
  },
  // Array of subdocuments
  data: [childSchemaData],
  slug: String

});

//we have to PRE-save slug before save the parentSchemaSymbol into DB
parentSchemaSymbol.pre('save', function (next) {
  if (!this.isModified('symbol')) {
    next()//skip it
    return//stop this function from running
  }
  this.slug = slug(this.symbol)
  next()
  //TODO make more resiliant soslug are unique
})

module.exports = mongoose.model('Stock', parentSchemaSymbol)
</code></pre>

<p><strong>Controller - webApiController.js</strong></p>

<pre><code>let curValueSchema = new parentSchemaSymbol()

      curValueSchema.symbol = curValue
      highLow.map(item =&gt; {
        curValueSchema.data.push(item)
      })
      const query = { symbol: `${curValue.toUpperCase()}` }
      const update = curValueSchema
      const options = { upsert: true, new: true }
      parentSchemaSymbol.findOneAndUpdate(query, update, options).then(doc =&gt; {
        console.log('Saved the symbol', doc)
        return res.send(highLow)
      }).catch(e =&gt; {
        console.log(e)
      })
</code></pre>

