Using MongooseJS to Changing Mongodb _id to BSON UUID for ref<p>I currently use MongooseJS to change "_id" for each of my collections to a BSON UUID. On top of this I use a virtual to "id" to convert "_id" to its string equivalent. It works pretty good and gives me the benefit of using a UUID for the "_id" and not store it as a string which wastes disk resources.</p>

<p>Here is a snippet of code to show how this is done</p>

<pre><code>const uuid = require("uuid-mongodb");
require("mongoose-uuid2")(mongoose);

let schema_options = {
    "id": false,
    "toObject": {
      "getters": true,
      "virtuals": true
    },
    "toJSON": {
      "getters": true,
      "virtuals": true,
      "transform"(doc, ret) {
        delete ret._id;
      }
    }   };

let schema = new Schema(
    {
      "_id": {
        "type": UUID,
        "default": uuid.v4,
        "required": true
      },
      "code": {
        "type": String,
        "required": true,
        "unique": true
      },
      "name": {
        "type": String,
        "required": true
      }
    },
    schema_options);

schema.virtual("id").get(function() {
   return uuid.from(this._id).toString();   
});

